import React, { useState, useEffect } from 'react';
import IndividualLocation from './IndividualLocation';

const Locations = () => {
  const [locations, setLocations] = useState([]);

  useEffect(() => {
    // Fetch data from the JSON file (in the src folder)
    // Assuming you have the locations data in your JSON file
    const data = {
      locations: {
        // ... your locations data
      },
      coffeeItems: [
        // ... your coffee items data
      ],
    };

    setLocations(data.locations);
  }, []);

  return (
    <div className="locations">
      <h1>All Locations</h1>
      {Object.keys(locations).map((city) => (
        <div key={city}>
          <h2>{city}</h2>
          {locations[city].map((location) => (
            <IndividualLocation key={location.name} name={location.name} address={location.address} />
          ))}
        </div>
      ))}
    </div>
  );
};

export default Locations;
